import React, { Component } from 'react'

class DailyGoals extends Component {
    render() {
        const {dailyTodos} = this.props;
        const displayTodos = this.props.dailyTodos.title.map(todo => {
            return(
                <div className="onedailygoal">
                    <div className="onedailygoalheading">
                        <h4>{todo.title} </h4>123
                    </div>
                </div> 
            )
        })

        return (
            <div className="onedailygoal">
                { displayTodos} 
                {/* {  console.log(dailyTodos)} */}
            </div> 
        )
    }
}

export default DailyGoals
